<template>
  <div id="app">
    <img alt="Vue logo" src="assets/logo.png">
    <HelloWorld msg="Welcome to Your Vue.js + TypeScript App"/>
  </div>
</template>

<script lang="ts">
import { Component, Vue } from 'vue-property-decorator';
import HelloWorld from './components/HelloWorld.vue';

const downloadFile = (filename: string, data: string) => {
  let _doc: any = document;
  let downloadLink = _doc.createElement("a");
  if (downloadLink) {
    _doc.body.appendChild(downloadLink);
    downloadLink.style = "display: none";
    downloadLink.download = filename;
    downloadLink.href = data;
    if (_doc.createEvent) {
      let downloadEvt = _doc.createEvent("MouseEvents");
      downloadEvt.initEvent("click", true, false);
      downloadLink.dispatchEvent(downloadEvt);
    } else if (_doc.createEventObject) {
      downloadLink.fireEvent("onclick");
    } else if (typeof downloadLink.onclick == "function") {
      downloadLink.onclick();
    }
    _doc.body.removeChild(downloadLink);
  }
};

@Component({
  components: {
    HelloWorld,
  },
})
export default class App extends Vue {
  mounted() {

    downloadFile('123','data:image/png;base64,')
  }
}
</script>

